import React, { useEffect, useState } from 'react';

export default function Users() {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    const getUsers = async () => {
      try {
        const data = await fetch('http://127.0.0.1:8000/Blog/GetAllUsersAdmin', {
          method: "GET",
        });

        const res = await data.json();
        console.log(res);

        if (res.status === "Success") {
          // Assuming the actual user data is in the 'users' property of the response
          setUsers(res.users);
        } else {
          // Handle error if needed
          console.error("Error fetching users:", res.message);
        }
      } catch (error) {
        // Handle network or other errors
        console.error("Error fetching users:", error);
      }
    };

    getUsers();
  }, []);

  return (
    <div>
      <h1>Users Blog</h1>
      <ul>
        {users.map((user) => (
          <li key={user.id}>{user.username}</li>
          // Adjust the property (e.g., 'username') based on your actual user data structure
        ))}
      </ul>
    </div>
  );
}
